    "Generates two buttons, in this case on and off with the respective values true and false. Replace TRIGGER with a unique value.": {"en": "Generates two buttons, in this case on and off with the respective values true and false. Replace TRIGGER with a unique value.", "de": "Erzeugt zwei Schaltflächen, in diesem Fall ein und aus, mit den jeweiligen Werten wahr und falsch. Ersetzen Sie TRIGGER durch einen eindeutigen Wert.", "ru": "Создает две кнопки, в данном случае «Вкл» и «Выкл» с соответствующими значениями true и false. Замените TRIGGER уникальным значением.", "pt": "Gera dois botões, neste caso liga e desliga com os respectivos valores verdadeiro e falso. Substitua TRIGGER por um valor exclusivo.", "nl": "Genereert twee knoppen, in dit geval aan en uit met de respectieve waarden waar en onwaar. Vervang TRIGGER door een unieke waarde.", "fr": "Génère deux boutons, en l'occurrence on et off avec les valeurs respectives true et false. Remplacez TRIGGER par une valeur unique.", "it": "Genera due pulsanti, in questo caso on e off con i rispettivi valori true e false. Sostituisci TRIGGER con un valore univoco.", "es": "Genera dos botones, en este caso encendido y apagado con los valores respectivos verdadero y falso. Reemplace TRIGGER con un valor único.", "pl": "Generuje dwa przyciski, w tym przypadku włączające i wyłączające z odpowiednimi wartościami prawda i fałsz. Zastąp TRIGGER unikalną wartością.", "uk": "Створює дві кнопки, у цьому випадку увімкнення та вимкнення з відповідними значеннями true та false. Замініть TRIGGER на унікальне значення.", "zh-cn": "生成两个按钮，在本例中为打开和关闭，其值分别为 true 和 false。将 TRIGGER 替换为唯一值。"},
    "Generates two buttons, in this case on and off with the respective values ​​true and false.": {"en": "Generates two buttons, in this case on and off with the respective values ​​true and false.", "de": "Erzeugt zwei Schaltflächen, in diesem Fall ein und aus mit den jeweiligen Werten wahr und falsch.", "ru": "Генерирует две кнопки, в данном случае «вкл» и «выкл» с соответствующими значениями true и false.", "pt": "Gera dois botões, neste caso liga e desliga com os respectivos valores verdadeiro e falso.", "nl": "Genereert twee knoppen, in dit geval aan en uit met de respectievelijke waarden waar en onwaar.", "fr": "Génère deux boutons, en l'occurrence on et off avec les valeurs respectives vrai et faux.", "it": "Genera due pulsanti, in questo caso on e off con i rispettivi valori true e false.", "es": "Genera dos botones, en este caso encendido y apagado con los respectivos valores verdadero y falso.", "pl": "Generuje dwa przyciski, w tym przypadku włączające i wyłączające z odpowiednimi wartościami prawda i fałsz.", "uk": "Генерує дві кнопки, у цьому випадку увімкнути та вимкнути з відповідними значеннями true та false.", "zh-cn": "生成两个按钮，在本例中为打开和关闭，其值分别为 true 和 false。"},
    "Global User activ": {                            "en": "Global user activ",                                "de": "Globaler Benutzer aktiv",                          "ru": "Активность глобального пользователя",              "pt": "Atividade global do usuário",                      "nl": "Globale gebruiker actief",                         "fr": "Activation globale de l'utilisateur",              "it": "Utente globale attivo",                            "es": "Actividad de usuario global",                      "pl": "Globalna aktywność użytkowników",                  "uk": "Глобальна активність користувачів",                "zh-cn": "全球用户活跃度"},
