    "Please Save the Nav Settings before you go to the aktions !!!": {"en": "Please Save the Nav Settings before you go to the aktions !!!", "de": "Bitte speichern Sie die Navigationseinstellungen, bevor Sie zu den Aktionen gehen !!!", "ru": "Пожалуйста, сохраните настройки навигации, прежде чем переходить к действиям !!!", "pt": "Salve as configurações de navegação antes de ir para as ações !!!", "nl": "Sla de navigatie-instellingen op voordat u naar de acties gaat !!!", "fr": "Veuillez enregistrer les paramètres de navigation avant de vous rendre aux aktions !!!", "it": "Si prega di salvare le impostazioni di navigazione prima di andare alle azioni!!!", "es": "¡Guarde la configuración de navegación antes de ir a las acciones!", "pl": "Zapisz ustawienia nawigacji, zanim przejdziesz do działań !!!", "uk": "Будь ласка, збережіть налаштування навігації, перш ніж переходити до дій !!!", "zh-cn": "请在执行操作之前保存导航设置！"},
    "Please check the triggers, save, and reopen this menu to close the error!": {"en": "Please check the triggers, save, and reopen this menu to close the error!", "de": "Bitte überprüfen Sie die Auslöser, speichern Sie und öffnen Sie dieses Menü erneut, um den Fehler zu schließen!", "ru": "Пожалуйста, проверьте триггеры, сохраните и снова откройте это меню, чтобы закрыть ошибку!", "pt": "Verifique os gatilhos, salve e reabra este menu para fechar o erro!", "nl": "Controleer de triggers, sla op en open dit menu opnieuw om de fout te sluiten!", "fr": "Veuillez vérifier les déclencheurs, enregistrer et rouvrir ce menu pour fermer l'erreur !", "it": "Controlla i trigger, salva e riapri questo menu per chiudere l'errore!", "es": "Verifique los disparadores, guarde y vuelva a abrir este menú para cerrar el error.", "pl": "Sprawdź wyzwalacze, zapisz i ponownie otwórz to menu, aby zamknąć błąd!", "uk": "Будь ласка, перевірте тригери, збережіть і знову відкрийте це меню, щоб закрити помилку!", "zh-cn": "请检查触发器，保存并重新打开此菜单以关闭错误！"},
    "Please select a user, or deaktivate the Menu, bevor you are can save!": {"en": "Please select a user, or deaktivate the Menu, bevor you can save!", "de": "Bitte wählen Sie einen Benutzer aus oder deaktivieren Sie das Menü, bevor Sie speichern können!", "ru": "Пожалуйста, выберите пользователя или деактивируйте меню, прежде чем вы сможете сохранить!", "pt": "Selecione um usuário ou desative o Menu antes de salvar!", "nl": "Selecteer een gebruiker of deactiveer het menu voordat u kunt opslaan!", "fr": "Veuillez sélectionner un utilisateur ou désactiver le menu avant de pouvoir enregistrer !", "it": "Seleziona un utente o disattiva il menu prima di poter salvare!", "es": "¡Seleccione un usuario o desactive el menú antes de poder guardar!", "pl": "Wybierz użytkownika lub dezaktywuj Menu, aby móc zapisać!", "uk": "Будь ласка, виберіть користувача або вимкніть меню, інакше ви зможете зберегти!", "zh-cn": "请选择一个用户，或取消激活菜单，然后才能保存！"},
    "Queries the value of the ID and then replaces it with the value, so text can be written around it": {"en": "Queries the value of the ID and then replaces it with the value, so text can be written around it", "de": "Fragt den Wert der ID ab und ersetzt ihn dann durch den Wert, sodass Text darum herum geschrieben werden kann", "ru": "Запрашивает значение идентификатора, а затем заменяет его значением, чтобы вокруг него можно было написать текст.", "pt": "Consulta o valor do ID e o substitui pelo valor, para que o texto possa ser escrito em torno dele", "nl": "Vraagt ​​de waarde van de ID op en vervangt deze vervolgens door de waarde, zodat er tekst omheen kan worden geschreven", "fr": "Interroge la valeur de l'ID, puis la remplace par la valeur, afin que du texte puisse être écrit autour de celui-ci.", "it": "Interroga il valore dell'ID e quindi lo sostituisce con il valore, in modo che sia possibile scrivere del testo attorno ad esso", "es": "Consulta el valor del ID y luego lo reemplaza con el valor, para que se pueda escribir texto a su alrededor.", "pl": "Wysyła zapytanie o wartość identyfikatora, a następnie zastępuje ją wartością, aby można było wokół niej zapisać tekst", "uk": "Запитує значення ідентифікатора, а потім замінює його значенням, щоб навколо нього можна було написати текст", "zh-cn": "查询 ID 的值，然后用该值替换它，以便可以在其周围写入文本"},
