    "Sets the value of the ID to the val, with ack(confirmed)": {"en": "Sets the value of the ID to the val, with ack(confirmed)", "de": "Setzt den Wert der ID auf den Wert, mit ack(bestätigt)", "ru": "Устанавливает значение идентификатора val с подтверждением (подтверждено).", "pt": "Define o valor do ID para val, com ack(confirmado)", "nl": "Stelt de waarde van de ID in op val, met ack(confirmed)", "fr": "Définit la valeur de l'ID sur le val, avec ack (confirmé)", "it": "Imposta il valore dell'ID su val, con ack(confirmed)", "es": "Establece el valor del ID en val, con ack(confirmado)", "pl": "Ustawia wartość identyfikatora na val, z potwierdzeniem (potwierdzone)", "uk": "Встановлює значення ідентифікатора як val з ack(confirmed)", "zh-cn": "将ID的值设置为val，带有ack（已确认）"},
